<p style="text-align: justify;"><span style="font-size: 12pt; font-family: Arial;"><b style="mso-bidi-font-weight: normal;"><span lang="PL">FinaTech Management sp. z o.o. </span></b><span lang="PL">posiada doswiadczenie w prowadzeniu obslugi kadrowo-ksiegowej dla wielu podmiotow min. deweloperow, firm konsultinogwych realizujacych projekty w Polsce i Niemczech. Koncentruje sie na dostarczaniu kompleksowych rozwiazan dla biznesu w zakresie ksiegowosci, naliczania wynagrodzen, obslugi kadrowej oraz swiadczy uslugi doradcze. Dodatkowo firma ma doswiadczenie z kompleksowym zaladaniu spolek osobowych i prawnych z ustawianiem systemow ksiegowych. Kadra firmy posiada wieloletnie doswiadczenie w ksigowosci z mozliwoscia prowadzenia obslugi dodatkowo w jezyku angielskim, niemieckim i rosyjskim.<br></span></span></p>
<p style="text-align: justify;"><br><span style="font-size: 12pt; font-family: Arial;"><!--[if gte mso 9]><xml>
